let pLength = 20  // standard 20
let constant = 0.015


let candle = record.current // Create everything from candles data

var typicalPrice = (candle.max + candle.min + candle.close) / 3

let typicalPriceSMA = 0
let meanDeviation = 0

variable.typicalPrices.push(typicalPrice) // put tp into array

if (variable.typicalPrices.length > pLength) {
    variable.typicalPrices.splice(0, 1)     // keep array at maximum length

    // do the calcs here
    typicalPriceSMA = variable.typicalPrices.reduce((a, b) => (a + b)) / variable.typicalPrices.length

    let TPsum = 0
    for (let i = 0; i < variable.typicalPrices.length; i++) {
        // step through typical prices
        // sum[TypicalPrice - MA]/P
        TPsum += Math.abs(variable.typicalPrices[i] - typicalPriceSMA)
    }

    meanDeviation = TPsum / variable.typicalPrices.length

    variable.value = (typicalPrice - typicalPriceSMA) / (constant * meanDeviation)

    if (isNaN(variable.value)) {
        variable.value = 0
    }
}

