function calculateEMA(price, previousEMA, periods) {
    let k = 2 / (1 + periods)
    let emaCalc = price * k + previousEMA * (1 - k)
    return emaCalc
}

function klingerEMAtulip(price, previousEMA, periods) {
    // tulipy method of EMA for klinger
    let v1 = (1 - 2 / (periods + 1)) * previousEMA
    let v2 = (2 / (periods + 1)) * price

    let result = v1 + v2
    return result
}

