// average(bp, tr_, length) => math.sum(bp, length) / math.sum(tr_, length)
function averageCalc(bp, tr) {
    const sum1 = bp.reduce((partialSum, a) => partialSum + a, 0)
    const sum2 = tr.reduce((partialSum, a) => partialSum + a, 0)

    let result = sum1 / sum2
    return result
}

