// Know Sure Thing momentum oscillator
let roclen1 = 10
let roclen2 = 15
let roclen3 = 20
let roclen4 = 30

let smalen1 = 10
let smalen2 = 10
let smalen3 = 10
let smalen4 = 15
let siglen = 9


let candle = record.current // Create everything from candles data

variable.closes.push(candle.close)
if (variable.closes.length > roclen4) {

    variable.roc4.push(RateOfChange(variable.closes))

    variable.closes.splice(0, 1)     // keep array at maximum length

    // calc rate of change
    variable.roc1.push(RateOfChange(variable.closes.slice(variable.closes.length - roclen1 - 1)))
    variable.roc2.push(RateOfChange(variable.closes.slice(variable.closes.length - roclen2 - 1)))
    variable.roc3.push(RateOfChange(variable.closes.slice(variable.closes.length - roclen3 - 1)))


    variable.rocTestP1 = candle.close
    variable.rocTestP2 = variable.closes.at(-1 * (roclen2 + 1))
} else {
    variable.roc1.push(0)
    variable.roc2.push(0)
    variable.roc3.push(0)
    variable.roc4.push(0)
}

// housekeeping
if (variable.roc1.length > roclen1) {
    variable.roc1.splice(0, 1)     // keep array at maximum length
}

if (variable.roc2.length > roclen2) {
    variable.roc2.splice(0, 1)     // keep array at maximum length
}

if (variable.roc3.length > roclen3) {
    variable.roc3.splice(0, 1)     // keep array at maximum length
}

if (variable.roc4.length > roclen4) {
    variable.roc4.splice(0, 1)     // keep array at maximum length
}

// calc sma of roc
if (variable.roc4.length == roclen4) {
    let tempSMA = []
    tempSMA = variable.roc1.slice(variable.roc1.length - smalen1)
    variable.sma1 = tempSMA.reduce((a, b) => (a + b)) / tempSMA.length

    tempSMA = variable.roc2.slice(variable.roc2.length - smalen2)
    variable.sma2 = tempSMA.reduce((a, b) => (a + b)) / tempSMA.length

    tempSMA = variable.roc3.slice(variable.roc3.length - smalen3)
    variable.sma2 = tempSMA.reduce((a, b) => (a + b)) / tempSMA.length

    tempSMA = variable.roc4.slice(variable.roc4.length - smalen4)
    variable.sma4 = tempSMA.reduce((a, b) => (a + b)) / tempSMA.length
}

variable.kst.push(variable.sma1 + 2 * variable.sma2 + 3 * variable.sma3 + 4 * variable.sma4)

if (variable.kst.length > siglen) {
    variable.kst.splice(0, 1)     // keep array at maximum length
}
variable.value = variable.kst.at(-1)
variable.signal = variable.kst.reduce((a, b) => (a + b)) / variable.kst.length

